import { Routes, Route } from 'react-router-dom';
import Auth from './components/comps/Auth/Auth';
import Account from './components/comps/Account';
import Asses from './components/comps/Asses';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route
          path={"/Auth"}
          element={<Auth/>}
        />
        <Route
          path={"/Account"}
          element={<Account></Account>}
        />
        <Route
          path={"/Asses"}
          element={<Asses></Asses>}
        />
        <Route
          path={"*"}
          element={<></>}
        />
      </Routes>
    </div>
  );
}

export default App;
